import React from 'react'
import axios from 'axios'
import { useEffect } from 'react'

const DashboardView = () => {

    useEffect(() => {
        axios.get('https://drug-info-and-price-history.p.rapidapi.com/1/druginfo')
    })

    return (
        <div>DashboardView</div>
    )
}

export default DashboardView
